import fetch from 'isomorphic-fetch';

const List = props => (
	<div>
		{props.list}
	</div>
);

List.getInitialProps = async () => {
	const res = await fetch('https://polls.apiblueprint.org/questions');
	const list = await res.json();

	return {
		list
	}
};

export default List;
